const createSecretHolder=e=>({secret:e,getSecret:function(){return this.secret},setSecret:function(e){this.secret=e}}),obj=createSecretHolder(5);obj.getSecret(),obj.setSecret(2),obj.getSecret();const sortArray=e=>{const t=[],r=[],o=[];for(let n=0;n<e.length;n++){t.push(e[n].toString(2));const s=t[n].split("");let c=0;for(let e=0;e<s.length;e++)"1"===s[e]&&c++;r.push(c),o.push({number:e[n],binaryNumber:t[n],bits:r[n]})}o.sort((function(e,t){return e.bits===t.bits?e.number-t.number:e.bits-t.bits}));for(let t=0;t<o.length;t++)e[t]=o[t].number;return e};sortArray([7,6,15,8]);const sortObj=e=>{const t=[],r=[];for(let t in e)e[t]>=60&&r.push({language:t,grade:e[t]});r.sort((e,t)=>t.grade-e.grade);for(let e=0;e<r.length;e++)t.push(r[e].language);return t};function doSetTimeout(e){setTimeout(()=>{console.log(e)},1e3)}sortObj({Hindi:60,Dutch:93,Greek:71});for(var i=0;i<5;i++)doSetTimeout(i);